# shinylive-ready Shiny app demonstrating violations of regression assumptions
# Single-file app.R

library(shiny)
library(car)      # for vif
library(MASS)     # for mvrnorm (kept for completeness)
library(shinyjs)  # for grey/disabled button

ui <- fluidPage(
  useShinyjs(),

  tags$head(
    # ---------- Fonts ----------
    tags$link(rel = "preconnect", href = "https://fonts.googleapis.com"),
    tags$link(rel = "preconnect", href = "https://fonts.gstatic.com", crossorigin = "crossorigin"),
    tags$link(
      href = "https://fonts.googleapis.com/css2?family=Lexend:wght@350;500&family=Recursive:wght,MONO@375,1&display=swap",
      rel = "stylesheet"
    ),

    # Make disabled buttons look muted/grey and unclickable
    tags$style(HTML("
      .action-button:disabled {
        opacity: 0.5 !important;
        filter: grayscale(0.6);
        cursor: not-allowed !important;
      }
    ")),


    # Optional: Fira Math if you have FiraMath-Regular.woff2 in ./www
    tags$style(HTML("
      @font-face {
        font-family: 'Fira Math';
        src: local('Fira Math'), url('FiraMath-Regular.woff2') format('woff2');
        font-weight: 400; font-style: normal; font-display: swap;
      }
    ")),

    # ---------- MathJax v3 (same pattern as your working app) ----------
    tags$script(HTML("
      window.MathJax = {
        loader: { load: ['[tex]/ams'] },
        tex: { packages: { '[+]': ['ams'] } }
      };
    ")),
    tags$script(src = "https://cdn.jsdelivr.net/npm/mathjax@3/es5/tex-chtml.js", id = "MathJax-script"),

    # Re-typeset on Shiny updates (watch calc, compare-math, and diag-box)
    tags$script(HTML("
      (function () {
        function typeset(target) {
          if (window.MathJax && MathJax.typesetPromise) {
            if (target) MathJax.typesetPromise([target]); else MathJax.typesetPromise();
          }
        }
        document.addEventListener('shiny:value', function(e) {
          if (e && (e.name === 'compare_lines' || e.name === 'diag_box')) {
            var cmp = document.getElementById('compare-math');
            var diag = document.getElementById('diag-box');
            if (e.name === 'compare_lines') typeset(cmp || undefined);
            if (e.name === 'diag_box') typeset(diag || undefined);
          } else {
            typeset();
          }
        });
        document.addEventListener('shiny:idle',  function(){ typeset(); });
        window.addEventListener('DOMContentLoaded', function () {
          var ids = ['compare-math', 'calc', 'diag-box'];
          if (window.MutationObserver) {
            ids.forEach(function(id){
              var el = document.getElementById(id);
              if (el) new MutationObserver(function(){ typeset(el); })
                       .observe(el, {childList:true, subtree:true});
            });
          }
          typeset();
        });
      })();
    ")),

    # iFrame resizer
    tags$script(src = "https://cdn.jsdelivr.net/npm/iframe-resizer/js/iframeResizer.contentWindow.min.js"),
    tags$script(HTML("
      document.addEventListener('shiny:idle', function () {
        if (window.parentIFrame && window.parentIFrame.size) { window.parentIFrame.size(); }
      });
    ")),

    # ---------- Theme ----------
    tags$style(HTML("/* =========================================================
