    # --- tiny JS: hamburger toggle + close on click ---
    tags$script(HTML("
    (function(){
      document.addEventListener('DOMContentLoaded', function(){
        var shell = document.querySelector('.app-topnav'); if(!shell) return;
        var burger = shell.querySelector('.app-burger');
        if(burger){
          burger.addEventListener('click', function(){
            shell.classList.toggle('open');
            if(window.parentIFrame && window.parentIFrame.size) window.parentIFrame.size();
          });
        }
        shell.addEventListener('click', function(e){
          if(e.target.tagName==='A' && shell.classList.contains('open')){
            shell.classList.remove('open');
            if(window.parentIFrame && window.parentIFrame.size) window.parentIFrame.size();
          }
        });
      });
    })();
