server <- function(input, output, session){
  # --- reactive datasets ---
  base_ds <- reactiveVal(NULL)  # original, no-violation data
  ds <- reactiveVal(NULL)       # dataset after applying currently selected violation

  # Helper: apply the selected violation to a copy of base data (no re-sampling of x)
  # Helper: apply the selected violation to a copy of base data (no re-sampling of x)
apply_violation <- function(sc, d) {
  if (is.null(d)) return(NULL)

  if (sc == "hetero") {
    xr <- range(d$x)
    x_norm <- if (xr[1] == xr[2]) rep(0, nrow(d)) else (d$x - xr[1]) / (xr[2] - xr[1] + 1e-12)
    h <- input$hetero_strength
    if (!("eps" %in% names(d))) d$eps <- 0
    if (h <= 1e-12) {
      d$y     <- input$beta0 + input$beta1 * d$x + d$eps
      d$sigma <- NULL
      return(d)
    } else {
      sigma <- 1 + h * (x_norm - 0.5)^2
      e_new <- d$eps * sigma
      d$y     <- input$beta0 + input$beta1 * d$x + e_new
      d$sigma <- sigma
      return(d)
    }

  } else if (sc == "nonlin") {
    # KEEP the initial sample: same x, same eps, same original y.
    # Just add β2 * x^2 on top. So when β2 = 0, you see the *exact* base sample.
    b2 <- input$beta2_nonlin
    d$y <- d$y + b2 * (d$x^2)
    d$sigma <- NULL
    return(d)

  } else if (sc == "collin") {
    x1    <- d$x
    rho_x <- input$rho_x
    x2    <- rho_x * x1 + sqrt(pmax(0, 1 - rho_x^2)) * rnorm(nrow(d))
    e_new <- rnorm(nrow(d))
    d$x1 <- x1
    d$x2 <- x2
    d$y  <- input$beta0 + input$beta1 * x1 + input$beta2_true * x2 + e_new
    return(d)
  }

  d
}


  # disable simulate button when violation is selected
  observe({
    if (identical(input$scenario, "none")) {
      shinyjs::enable("simulate")
    } else {
      shinyjs::disable("simulate")
    }
  })

  # Simulate/overwrite the BASE dataset (no violation) using current n_base, beta0, beta1
  observeEvent(input$simulate, {
    if (is.null(base_ds()) || identical(input$scenario, "none")) {
      n <- if (isTruthy(input$n_base)) input$n_base else 100
      x <- rnorm(n)
      e <- rnorm(n)
      y <- input$beta0 + input$beta1 * x + e
      base_ds(data.frame(x = x, y = y, eps = e))
    }
    ds(apply_violation(input$scenario, base_ds()))
  })

  # Changing violation or its parameters re-computes from the SAME base (no re-simulate)
  observeEvent(
    list(
      input$scenario,
      input$hetero_strength,
      input$beta2_nonlin,
      input$rho_x,
      input$beta2_true,
      input$beta0,
      input$beta1
    ),
    {
      if (!is.null(base_ds())) {
        ds(apply_violation(input$scenario, base_ds()))
      }
    },
    ignoreInit = TRUE
  )

  # Reset both datasets and restore defaults
  observeEvent(input$clear, {
    base_ds(NULL); ds(NULL)
    updateNumericInput(session, "n_base", value = 100)
    updateTextInput(session, "xlab", value = "x")
    updateTextInput(session, "ylab", value = "y")
    updateNumericInput(session, "beta0", value = 0)
    updateNumericInput(session, "beta1", value = 1)
    updateSelectInput(session, "scenario", selected = "none")
  })

  # ---------- MAIN PLOT ----------
  output$mainPlot <- renderPlot({
    d <- ds(); req(d)

    par(mar = c(4.6, 5.6, 2.0, 1.2) + 0.1,
        mgp = c(2.1, 0.55, 0),
        cex.lab = 0.9, cex.axis = 0.8,
        col.lab = "#ffffff", col.axis = "#ffffff", fg = "#ffffff")

    if (input$scenario != "collin") {
      xvals <- d$x; yvals <- d$y

      # --- symmetric axes around 0 ---
      xmax <- max(abs(xvals), na.rm = TRUE)
      ymax <- max(abs(yvals), na.rm = TRUE)
      xlim <- c(-xmax, xmax)
      ylim <- c(-ymax, ymax)

      plot(NA, xlim = xlim, ylim = ylim,
           xlab = input$xlab, ylab = input$ylab,
           axes = FALSE, xaxs = "i", yaxs = "i")
      axis(1, col = "#ffffff", col.axis = "#ffffff")
      axis(2, col = "#ffffff", col.axis = "#ffffff")
      abline(h = 0, v = 0, col = "#ffffff", lwd = 1)

      points(xvals, yvals, pch = 16, cex = 1.2, col = "#ffffff")
      fit <- tryCatch(lm(y ~ x, data = d), error = function(e) NULL)
      if (!is.null(fit)) abline(fit, lwd = 2.8, col = "#cb7334")

      if (!is.null(fit)) {
        mtext(sprintf("\u0177 = %s + %s \u00B7 x",
                      round(coef(fit)[1], 3),
                      round(coef(fit)[2], 3)),
              side = 3, line = 0.6, cex = 1.4, col = "#ffffff")
      }

      # heteroskedasticity sigma curve
      if (!is.null(d$sigma)) {
        oo <- order(xvals)
        lines(xvals[oo],
              d$sigma[oo] + mean(yvals) - mean(d$sigma),
              lty = 2, lwd=3, col = "#8a1e00")
        legend("topleft",
               legend = c("Fitted regression", "Error spread (σ)"),
               lty = c(1, 2), lwd = c(2, 1),
               col = c("#ffffff", "#ffffff"),
               bg = "#1d1f2b", text.col = "#ffffff", cex = 0.8)
      }

      # dashed quadratic overlay only for nonlinearity scenario
      if (identical(input$scenario, "nonlin")) {
        fq <- tryCatch(lm(y ~ x + I(x^2), data = d), error = function(e) NULL)
        if (!is.null(fq)) {
          xs <- seq(min(xvals), max(xvals), length.out = 400)
          pred_q <- coef(fq)[1] + coef(fq)[2]*xs + coef(fq)[3]*xs^2
          lines(xs, pred_q, lty = 2, lwd = 3, col = "#8a1e00")
          legend("bottomright",
                 legend = c("Linear OLS", "Quadratic OLS (dashed)"),
                 lty = c(1, 2), lwd = c(2.8, 2),
                 col = c("#cb7334", "#8a1e00"),
                 bg = "#1d1f2b", text.col = "#ffffff", cex = 0.8)
        }
      }

    } else {
      pairs(d[, c("x1","x2","y")],
            labels = c("x1","x2","y"),
            upper.panel = NULL,
            gap = 0.6,
            panel = function(x, y, ...) {
              points(x, y, pch = 16, col = "#ffffff")
            },
            diag.panel = function(x, ...) {
              usr <- par("usr")
              rect(usr[1], usr[3], usr[2], usr[4], col = NA, border = NA)
            })
    }
  }, bg = "transparent")

  # ---- helper: HC3 robust SE for a fitted lm ----
  robust_se_hc3 <- function(fit){
    X <- model.matrix(fit)
    e <- residuals(fit)
    n <- nrow(X); k <- ncol(X)
    XtX_inv <- tryCatch(solve(t(X) %*% X), error = function(err) NULL)
    if (is.null(XtX_inv)) return(rep(NA_real_, k))
    H <- X %*% XtX_inv %*% t(X)
    h <- pmin(1 - 1e-8, diag(H))
    u <- e / (1 - h)     # HC3
    meat <- t(X) %*% diag(u^2, n, n) %*% X
    V <- XtX_inv %*% meat %*% XtX_inv
    se <- sqrt(pmax(0, diag(V)))
    names(se) <- colnames(X)
    se
  }

  # helper: compact comparison table
  sig_table <- function(rows){
    header <- tags$tr(
      tags$th("Variable"),
      tags$th("Estimate"),
      tags$th("SE (OLS)"),
      tags$th("SE (HC3)"),
      tags$th("p (OLS)"),
      tags$th("p (HC3)")
    )
    body <- lapply(rows, function(r){
      tags$tr(
        tags$td(HTML(r$name)),
        tags$td(r$est),
        tags$td(r$se_ols),
        tags$td(r$se_hc3),
        tags$td(r$p_ols),
        tags$td(r$p_hc3)
      )
    })
    tags$table(
      style="width:100%; border-collapse:collapse; margin-top:.5em;",
      tags$thead(header),
      tags$tbody(body)
    )
  }

  # --- Compact OLS-only table (no HC3) ---
  sig_table_ols <- function(rows){
    # rows: list of lists with keys: name, est, se_ols, p_ols
    header <- tags$tr(
      tags$th("Variable"),
      tags$th("Estimate"),
      tags$th("SE (OLS)"),
      tags$th("p (OLS)")
    )
    body <- lapply(rows, function(r){
      tags$tr(
        tags$td(HTML(r$name)),
        tags$td(r$est),
        tags$td(r$se_ols),
        tags$td(r$p_ols)
      )
    })
    tags$table(
      style="width:100%; border-collapse:collapse; margin-top:.5em;",
      tags$thead(header),
      tags$tbody(body)
    )
  }

  # ---- Diagnostics card (with tests per scenario) ----
  output$diag_box <- renderUI({
    d <- ds()
    if (is.null(d)) {
      return(tags$div(
        tags$strong("Diagnostics"),
        tags$p("Simulate data to see diagnostics here.")
      ))
    }

    fmt  <- function(z, dgt = 3) ifelse(is.finite(z), formatC(z, digits = dgt, format = "f"), "NA")
    fmtP <- function(p) {
      if (!is.finite(p)) return("NA")
      if (p < 0.001) return("< 0.001")
      formatC(p, digits = 3, format = "f")
    }
    sig_label <- function(p) {
      if (!is.finite(p)) return("n/a")
      if (p < 0.01) return("**")
      if (p < 0.05) return("*")
      ""
    }

    if (input$scenario == "hetero") {
      fit <- tryCatch(lm(y ~ x, data = d), error = function(e) NULL); if (is.null(fit)) return(NULL)
      # Breusch–Pagan (approx via R^2 of res^2 ~ fitted)
      resids_sq <- residuals(fit)^2
      bp    <- tryCatch(lm(resids_sq ~ fitted(fit)), error = function(e) NULL)
      bp_r2 <- if (!is.null(bp)) summary(bp)$r.squared else NA_real_
      bp_chi <- if (is.finite(bp_r2)) bp_r2 * length(d$y) else NA_real_
      bp_p   <- if (is.finite(bp_chi)) 1 - pchisq(bp_chi, df = 1) else NA_real_
      # OLS vs HC3 for beta_x
      est  <- coef(fit)["x"]
      se_o <- summary(fit)$coefficients["x", "Std. Error"]
      se_r <- robust_se_hc3(fit)["x"]
      t_o  <- est / se_o; p_o <- 2 * pt(-abs(t_o), df = nrow(d) - 2)
      t_r  <- est / se_r; p_r <- 2 * pnorm(-abs(t_r))

      rows <- list(list(
        name="x (slope)",
        est=fmt(est),
        se_ols=fmt(se_o),
        se_hc3=fmt(se_r),
        p_ols=paste0(fmtP(p_o), sig_label(p_o)),
        p_hc3=paste0(fmtP(p_r), sig_label(p_r))
      ))

      tags$div(
        tags$strong("Diagnostics"),
        tags$ul(
          tags$li(HTML("Assumption: \\(\\operatorname{Var}(\\varepsilon_i\\mid X)=\\sigma^2\\) (homoskedasticity).")),
          tags$li(HTML("Here: \\(\\sigma(x)=1 + h\\,(x^*-\\tfrac{1}{2})^2\\) with \\(x^*\\in[0,1]\\) (bowtie pattern).")),
          tags$li(HTML(sprintf("<span style='font-style:normal;'>Breusch–Pagan (approx):</span> stat = <strong>%s</strong>, p = <strong>%s</strong>", fmt(bp_chi), fmtP(bp_p)))),
          tags$li(HTML("<span style='font-style:normal;'>Significance comparison</span> (slope \\(\\hat{\\beta}_1\\)):")),
          sig_table(rows)
        )
      )

    } else if (input$scenario == "nonlin") {
      # Linear vs Quadratic + RESET-style
      fit_lin  <- tryCatch(lm(y ~ x, data = d), error = function(e) NULL); if (is.null(fit_lin)) return(NULL)
      fit_quad <- tryCatch(lm(y ~ x + I(x^2), data = d), error = function(e) NULL)

      # F-test (nested) Lin vs Quad
      ftest_p <- if (!is.null(fit_quad)) {
        an <- anova(fit_lin, fit_quad)
        if (nrow(an) == 2) an$`Pr(>F)`[2] else NA_real_
      } else NA_real_

      # RESET-style: add powers of fitted values from linear model
      fv <- fitted(fit_lin)
      fit_reset <- tryCatch(lm(y ~ x + I(fv^2) + I(fv^3), data = d), error = function(e) NULL)
      reset_p <- if (!is.null(fit_reset)) {
        an <- anova(fit_lin, fit_reset)
        if (nrow(an) == 2) an$`Pr(>F)`[2] else NA_real_
      } else NA_real_

      # Show significance of x and x^2 using OLS only
      if (!is.null(fit_quad)) {
        summ <- summary(fit_quad)$coefficients
        mkrow_ols <- function(var, label){
          est <- coef(fit_quad)[var]
          seo <- summ[var, "Std. Error"]
          to  <- est/seo
          po  <- 2*pt(-abs(to), df = nrow(d) - 3)  # df = n - k, k=3
          list(
            name  = label,
            est   = fmt(est),
            se_ols= fmt(seo),
            p_ols  = paste0(fmtP(po), sig_label(po))
          )
        }
        rows <- list(
          mkrow_ols("(Intercept)", "Intercept"),
          mkrow_ols("x", "x"),
          mkrow_ols("I(x^2)", HTML("x<sup>2</sup>"))
        )
      } else {
        rows <- list()
      }

      tags$div(
        tags$strong("Diagnostics"),
        tags$ul(
          tags$li(HTML("Functional form: data generated as \\(y=\\beta_0+\\beta_1 x + \\beta_2 x^2 + \\varepsilon\\). Linear OLS may be misspecified if \\(\\beta_2\\neq 0\\).")),
          tags$li(HTML(sprintf("<span style='font-style:normal;'>Linear vs quadratic (F-test)</span>: p = <strong>%s</strong>", fmtP(ftest_p)))),
          tags$li(HTML(sprintf("<span style='font-style:normal;'>RESET-style test</span>: p = <strong>%s</strong>", fmtP(reset_p)))),
          if (length(rows)) tags$li(HTML("<span style='font-style:normal;'>Quadratic OLS coefficients:</span>")),
          if (length(rows)) sig_table_ols(rows)
        )
      )



    } else if (input$scenario == "collin") {
      fit2 <- tryCatch(lm(y ~ x1 + x2, data = d), error = function(e) NULL)
      if (is.null(fit2)) return(NULL)
      vifvals <- tryCatch(car::vif(fit2), error = function(e) NA)
      vif_x1 <- tryCatch(as.numeric(vifvals["x1"]), error = function(e) NA)
      vif_x2 <- tryCatch(as.numeric(vifvals["x2"]), error = function(e) NA)

      # classic OLS estimates only
      coefs <- coef(fit2)
      summ  <- summary(fit2)$coefficients
      mkrow <- function(var, label){
        est <- coefs[var]
        seo <- summ[var, "Std. Error"]
        to  <- est/seo; po <- 2*pt(-abs(to), df=nrow(d)-3)
        list(
          name  = label,
          est   = fmt(est),
          se_ols= fmt(seo),
          p_ols  = paste0(fmtP(po), sig_label(po))
        )
      }
      rows <- list(
        mkrow("(Intercept)", "Intercept"),
        mkrow("x1", "x1"),
        mkrow("x2", "x2")
      )

      # Compare x1 coefficient when omitting x2
      fit_omit <- tryCatch(lm(y ~ x1, data = d), error = function(e) NULL)
      b_both <- if (!is.null(fit2) && !is.na(coef(fit2)["x1"])) coef(fit2)["x1"] else NA
      b_omit <- if (!is.null(fit_omit) && !is.na(coef(fit_omit)["x1"])) coef(fit_omit)["x1"] else NA

      tags$div(
        tags$strong("Diagnostics"),
        tags$ul(
          tags$li(HTML("Assumption: no perfect multicollinearity.")),
          tags$li(HTML(sprintf("\\(\\mathrm{corr}(x_1,x_2)=\\mathbf{%s}\\)", fmt(cor(d$x1, d$x2))))),
          tags$li(HTML(sprintf("\\(\\mathrm{VIF}(x_1)=\\mathbf{%s}\\), \\(\\mathrm{VIF}(x_2)=\\mathbf{%s}\\)", fmt(vif_x1), fmt(vif_x2)))),
          tags$li(HTML("<span style='font-style:normal;'>Coefficient table:</span>")),
          sig_table_ols(rows),
          tags$li(HTML(sprintf("Coefficient instability: \\(\\hat{\\beta}_1\\) with both \\(x_1\\) & \\(x_2\\) = %s; with \\(x_1\\) only = %s",
                               fmt(b_both), fmt(b_omit))))
        )
      )


    } else {
      tags$div(
        tags$strong("Diagnostics"),
        tags$p("No violation selected.")
      )
    }
  })

  # ---------- Compare lines block (LaTeX; MathJax handles typesetting) ----------
  output$compare_lines <- renderUI({
    if (is.null(base_ds()) || is.null(ds()) || identical(input$scenario, "none")) return(NULL)
    base <- base_ds()
    cur  <- ds()

    fmt <- function(z) formatC(z, digits = 3, format = "f", drop0trailing = TRUE)

    if (!identical(input$scenario, "collin")) {
      base_fit <- tryCatch(lm(y ~ x, data = base), error = function(e) NULL)
      viol_fit <- tryCatch(lm(y ~ x, data = cur),  error = function(e) NULL)
      if (is.null(base_fit) || is.null(viol_fit)) return(NULL)
      b0b <- coef(base_fit)[1]; b1b <- coef(base_fit)[2]
      b0v <- coef(viol_fit)[1]; b1v <- coef(viol_fit)[2]
      base_eq <- sprintf('\\[\\hat{y} = %s + %s\\,x\\]', fmt(b0b), fmt(b1b))
      viol_eq <- sprintf('\\[\\hat{y} = %s + %s\\,x\\]', fmt(b0v), fmt(b1v))
      return(tagList(
        tags$div(style = "font-weight:600; margin-bottom:.35rem;", "Model comparison"),
        tags$div(HTML("<em>Base (no violation)</em>")), tags$div(HTML(base_eq)),
        tags$div(HTML("<em>With violation</em>")),        tags$div(HTML(viol_eq))
      ))
    }

    # === Collinearity: compare rho = 0 vs current rho (>0) ===
    if (!all(c("x1","x2","y") %in% names(cur))) return(NULL)

    rho <- as.numeric(input$rho_x)
    eps <- .Machine$double.eps
    denom <- sqrt(pmax(1 - rho^2, eps))

    # Recover latent innovation z so that when rho=0 we get EXACT same x2
    z_hat <- (cur$x2 - rho * cur$x1) / denom              # approx original z draw
    x2_unc <- z_hat                                       # counterfactual x2 at rho=0

    # Preserve realized errors: e_i = y_i - (β0 + β1 x1_i + β2 x2_i)
    e_real <- cur$y - (input$beta0 + input$beta1 * cur$x1 + input$beta2_true * cur$x2)

    # Counterfactual y with rho = 0 (same x1, same errors, x2 replaced by z_hat)
    y_uncorr <- input$beta0 + input$beta1 * cur$x1 + input$beta2_true * x2_unc + e_real

    # Fit both models
    fit_unc  <- tryCatch(lm(y_uncorr ~ cur$x1 + x2_unc), error = function(e) NULL)
    fit_corr <- tryCatch(lm(y        ~ x1     + x2,      data = cur), error = function(e) NULL)
    if (is.null(fit_unc) || is.null(fit_corr)) return(NULL)

    co_u <- coef(fit_unc);  b0u <- co_u[1]; b1u <- co_u[2]; b2u <- co_u[3]
    co_c <- coef(fit_corr); b0c <- co_c[1]; b1c <- co_c["x1"]; b2c <- co_c["x2"]

    eq_unc <- sprintf('\\[\\hat{y}_{\\rho=0} = %s + %s\\,x_{1} + %s\\,x_{2}\\]', fmt(b0u), fmt(b1u), fmt(b2u))
    eq_cor <- sprintf('\\[\\hat{y}_{\\rho=%.2f} = %s + %s\\,x_{1} + %s\\,x_{2}\\]', rho, fmt(b0c), fmt(b1c), fmt(b2c))

    tagList(
      tags$div(style = "font-weight:600; margin-bottom:.35rem;", "Model comparison"),
      tags$div(HTML("<em>Uncorrelated regressors (</em>\\(\\rho=0\\)<em>)</em>")),
      tags$div(HTML(eq_unc)),
      tags$div(HTML("<em>Correlated regressors (current)</em>")),
      tags$div(HTML(eq_cor))
    )
  })



  # ---------- MODEL OUTPUT ----------
  output$summary_out <- renderPrint({
    d <- ds(); if (is.null(d)) { cat("Simulate data to see model output.") ; return() }

    if (input$scenario != "collin"){
      fit <- tryCatch(lm(y ~ x, data = d), error = function(e) NULL)
      if (is.null(fit)) { cat("Model failed to fit.") ; return() }
      s <- summary(fit)
      est <- coef(fit)[2]
      bias <- est - input$beta1
      cat("Simple OLS (y ~ x)\n")
      print(s)
      cat(sprintf('\nTrue \u03B2_1 = %g, Estimated = %0.4g, Bias = %0.4g\n', input$beta1, est, bias))

      if (input$scenario == "hetero"){
        cat(sprintf('\nHeteroskedasticity: SEs from OLS are not valid (they rely on homoscedasticity).\nWe display a Breusch-Pagan style approximation below.\n'))
      }
      if (input$scenario == "nonlin"){
        cat('\nNonlinearity: consider comparing linear vs quadratic fits (see diagnostics).\n')
      }

    } else {
      cat("Multivariate OLS (y ~ x1 + x2)\n")
      fit2 <- tryCatch(lm(y ~ x1 + x2, data = d), error = function(e) NULL)
      if (is.null(fit2)) { cat('Model failed to fit.\n') ; return() }
      s2 <- summary(fit2)
      print(s2)
      vifvals <- tryCatch(vif(fit2), error = function(e) NA)
      cat('\nVariance Inflation Factors (VIF):\n')
      print(vifvals)

      fit_omit <- tryCatch(lm(y ~ x1, data = d), error = function(e) NULL)
      cat('\nCompare estimates when omitting x2 (shows instability):\n')
      b_both <- if (!is.null(fit2) && !is.na(coef(fit2)["x1"])) coef(fit2)["x1"] else NA
      b_omit <- if (!is.null(fit_omit) && !is.na(coef(fit_omit)["x1"])) coef(fit_omit)["x1"] else NA
      cat(sprintf('Estimate of beta1 (both x1 & x2): %s\n', ifelse(is.finite(b_both), formatC(b_both, digits = 4, format = 'f'), as.character(b_both))))
      cat(sprintf('Estimate of beta1 (only x1): %s\n', ifelse(is.finite(b_omit), formatC(b_omit, digits = 4, format = 'f'), as.character(b_omit))))
    }
  })
